import React from 'react';
import { ButtonGroup, Button } from 'react-bootstrap';

export const Continents = ({ continents }) => {

    function getRegions() {
        console.log("getRegion function is triggered!");
    }

    return (
        <div>
            <ButtonGroup key="continents" size="lg" className="mb-2">
                {continents.map(cont => <Button key={cont} variant="secondary" onClick={getRegions}>{cont}</Button>)}
            </ButtonGroup>
        </div>
    )
}
